import { Component, HostBinding, ViewEncapsulation, ViewChild, OnInit, OnDestroy } from '@angular/core';
import { isEqual, pick } from 'lodash';
import { BsModalService, BsModalRef } from 'ngx-bootstrap/modal';
import { Subscription } from 'rxjs';
import { LocalStorageService } from 'angular-2-local-storage';

import { ApiService } from '../../../../service/api/api.service';
import { AuthService } from '../../../../service/auth/auth.service';
import { LoadingService } from '../../../../service/loading/loading.service';
import { AlertService } from '../../../../service/alert/alert.service';
import { Page, Effect, PageConfig } from '../../shared/interface';
import { Customer } from '../../../../shared/interface';
import { AnimationProvider } from '../../shared/provider';
import { inEffects } from '../../shared/effect';

declare var window: any;

@Component({
    selector: 'app-animpage',
    templateUrl: './animpage.component.html',
    styleUrls: ['./animpage.component.scss'],
    encapsulation: ViewEncapsulation.None
})
export class AnimpageComponent implements OnInit, OnDestroy {

    @HostBinding('class') className = 'd-flex flex-fill';

    @ViewChild('inDemoImg') inDemoImg: any;
    @ViewChild('outDemoImg') outDemoImg: any;
    @ViewChild('subscriptionModalTemplate') subscriptionModalTemplate: any;
    @ViewChild('confirmUninstallModalTemplate') confirmUninstallModalTemplate: any;
    @ViewChild('confirmUnsubscribeModalTemplate') confirmUnsubscribeModalTemplate: any;

    public subscriptionModalRef: BsModalRef;
    public confirmUninstallModalRef: BsModalRef;
    public confirmUnsubscribeModalRef: BsModalRef;

    private subscriptionCustomer: Subscription = null;
    private customer: Customer = null;

    demoImg = 'data:image/png;base64,';

    inEffects: Effect[] = [];

    outEffects: Effect[] = [];

    inDemo: AnimationProvider = new AnimationProvider();

    outDemo: AnimationProvider = new AnimationProvider();

    page: string = 'all';

    pages: Page[] = [];

    _modelDefault: PageConfig = new PageConfig;

    modelDefault: PageConfig = new PageConfig;

    model: PageConfig = new PageConfig;

    constructor(
        private modalService: BsModalService,
        private localStorageService: LocalStorageService,
        private apiService: ApiService,
        private loadingService: LoadingService,
        private alertService: AlertService,
        private authService: AuthService
    ) {}

    ngOnInit() {

        this.subscriptionCustomer = this.authService.customer$.subscribe((customer: Customer) => {

            if (!customer || !customer.customerId) {
                return;
            }

            this.customer = customer;

            this.inEffects = inEffects.map((effect: Effect) => {

                return {
                    effectId: effect.effectId,
                    title: effect.title + (this.isEffectPaid(effect.effectId) ? ' *' : '')
                };
            });

            this.outEffects = this.inEffects.map((effect: Effect) => {

                return {
                    effectId: (effect.effectId ? effect.effectId.replace(/In/, 'Out') : effect.effectId),
                    title: (effect.effectId ? effect.title.replace(/In/, 'Out') : effect.title)
                };
            });

            this.getPages();

            const save: any = this.localStorageService.get('save');

            this.localStorageService.remove('save');

            if (save && this.hasSubscription()) {

                this.page = save.page;

                return this.saveConfirm(save.model);
            }

            this.onPageChange();
        });
    }

    ngOnDestroy() {

        this.subscriptionCustomer.unsubscribe();
    }

    hasSubscription() {

        return this.customer.ext && this.customer.ext.match(/subscription/);
    }

    isPagePaid (pageId: string) {

        return ['all', 'home'].indexOf(pageId) === -1 && !this.hasSubscription();
    }

    isEffectPaid (effectId: string) {

        return effectId && ['fadeIn', 'bounceIn', 'rotateIn', 'fadeOut', 'bounceOut', 'rotateOut'].indexOf(effectId) === -1 && !this.hasSubscription();
    }

    hasPaidOptions () {

        return this.isPagePaid(this.page) || this.isEffectPaid(this.model.inEffect) || this.isEffectPaid(this.model.outEffect);
    }

    getPages () {

        this.loadingService.start();

        this.apiService.get('page').subscribe(
            (pages: Page[]) => {

                this.loadingService.stop();

                this.pages = pages;

                this.pages.forEach((page: Page) => {

                    if (this.isPagePaid(page.pageId)) {
                        page.title += ' *';
                    }
                });
            },
            (err: any) => this.onError(err)
        );
    }

    sliderTooltipFormatter (value: any) {

        return Number(value / 1000).toFixed(1).replace(/\.0$/, '') + ' sec';
    }

    onPageChange () {

        this.loadingService.start();

        this.apiService.get('page/' + encodeURIComponent(this.page)).subscribe(
            (pageConfig: PageConfig) => this.onSuccess(pageConfig),
            (err: any) => this.onError(err)
        );
    }

    onValueChange () {

        this.startInAnimation();

        if (!this.model.sync) {
            return;
        }

        this.model.outDuration = this.model.inDuration;
        this.model.outEffect = this.model.inEffect ? this.model.inEffect.replace(/In/, 'Out') : this.model.inEffect;
    }

    isEqual (obj1: any, obj2: any) {

        return isEqual(pick(obj1, ['inEffect', 'outEffect', 'inDuration', 'outDuration']), pick(obj2, ['inEffect', 'outEffect', 'inDuration', 'outDuration']));
    }

    reset () {

        this.loadingService.start();

        this.apiService.remove('page/' + encodeURIComponent(this.page)).subscribe(
            (pageConfig: PageConfig) => {

                this.onSuccess(pageConfig);

                this.alertService.show({
                    type: 'success',
                    text: 'Page Config Removed'
                });
            },
            (err: any) => this.onError(err)
        );
    }

    save () {

        if (this.hasPaidOptions()) {

            this.subscriptionModalRef = this.modalService.show(this.subscriptionModalTemplate);

            return;
        }

        this.saveConfirm();
    }

    saveConfirm (model: PageConfig = null) {

        this.loadingService.start();

        const pageConfigClean = pick(model || this.model, ['sync', 'inEffect', 'outEffect', 'inDuration', 'outDuration']);

        pageConfigClean.inEffect = pageConfigClean.inEffect || '';
        pageConfigClean.outEffect = pageConfigClean.outEffect || '';

        this.apiService.put('page/' + encodeURIComponent(this.page), pageConfigClean).subscribe(
            (pageConfig: PageConfig) => {

                this.onSuccess(pageConfig);

                this.alertService.show({
                    type: 'success',
                    text: 'Page Config Saved'
                });
            },
            (err: any) => this.onError(err)
        );
    }

    onSuccess (pageConfig: PageConfig) {

        this.loadingService.stop();

        const pageConfigClean = pick(pageConfig, ['sync', 'inEffect', 'outEffect', 'inDuration', 'outDuration']);

        Object.assign(this.modelDefault, pageConfigClean);
        Object.assign(this.model, pageConfigClean);

        this.startInAnimation();
        this.startOutAnimation();
    }

    onError (err: any) {

        this.loadingService.stop();

        this.alertService.show({
            text: err.message
        });
    }

    uninstall () {

        this.confirmUninstallModalRef = this.modalService.show(this.confirmUninstallModalTemplate);
    }

    uninstallConfirm () {

        this.confirmUninstallModalRef.hide();

        this.loadingService.start();

        this.apiService.remove('auth/uninstall').subscribe(
            (result: any) => {

                window.top.location.href = result.redirectUrl;
            },
            (err: any) => this.onError(err)
        );
    }

    startInAnimation () {

        this.inDemo.start(this.inDemoImg, this.model.inEffect, this.model.inDuration, true);
    }

    startOutAnimation () {

        this.outDemo.start(this.outDemoImg, this.model.outEffect, this.model.outDuration, false);
    }

    checkout () {

        this.subscriptionModalRef.hide();

        this.loadingService.start();

        this.apiService.post('payment').subscribe(
            (result: any) => {

                this.localStorageService.set('save', {
                    page: this.page,
                    model: this.model
                });

                window.top.location.href = result.redirectUrl;
            },
            (err: any) => this.onError(err)
        );
    }

    unsubscribe () {

        this.confirmUnsubscribeModalRef = this.modalService.show(this.confirmUnsubscribeModalTemplate);
    }

    unsubscribeConfirm () {

        this.confirmUnsubscribeModalRef.hide();

        this.loadingService.start();

        this.apiService.remove('payment/subscription').subscribe(
            () => {

                this.loadingService.stop();

                this.customer.ext = null;
                this.authService.customer$.next(this.customer);
            },
            (err: any) => this.onError(err)
        );
    }
}
